    [TestClass]
    public class UnitTests
    {
        [TestInitialize]
        public void TestInit()
        {
            var retVal = Frends.Community.RabbitMQ.RabbitMQTask.ReadMessage(new ReadInputParams { HostName = "localhost", QueueName = "queue", AutoAck = true, ReadMessageCount = 1000 });
        }

        [TestMethod]
        public void TestWriteRead()
        {
            Frends.Community.RabbitMQ.RabbitMQTask.WriteMessage(new WriteInputParams { Data = new byte[] { 0, 1, 2 }, HostName = "localhost", RoutingKey = "queue", QueueName = "queue" });
            var retVal = Frends.Community.RabbitMQ.RabbitMQTask.ReadMessage(new ReadInputParams { HostName = "localhost", QueueName = "queue", AutoAck = true, ReadMessageCount = 1 });
            Assert.IsTrue(retVal== "{\"messages\": [\r\n{\"deliveryTag\":1, \"body\":\"AAEC \", \"messageCount\":0,\"routingKey\":\"queue\" }]}\r\n");
        }

        [TestMethod]
        public void TestReadWithAck10()
        {
            for(int i  = 0; i < 10;i++)
                Frends.Community.RabbitMQ.RabbitMQTask.WriteMessage(new WriteInputParams { Data = new byte[] { 0, (byte)(i * i), (byte)i }, HostName = "localhost", RoutingKey = "queue", QueueName = "queue" });
            var retVal = Frends.Community.RabbitMQ.RabbitMQTask.ReadMessage(new ReadInputParams { HostName = "localhost", QueueName = "queue", AutoAck = true, ReadMessageCount = 1000 });
            Assert.IsTrue(retVal == "{\"messages\": [\r\n{\"deliveryTag\":1, \"body\":\"AAAA \", \"messageCount\":9,\"routingKey\":\"queue\" },{\"deliveryTag\":2, \"body\":\"AAEB \", \"messageCount\":8,\"routingKey\":\"queue\" },{\"deliveryTag\":3, \"body\":\"AAQC \", \"messageCount\":7,\"routingKey\":\"queue\" },{\"deliveryTag\":4, \"body\":\"AAkD \", \"messageCount\":6,\"routingKey\":\"queue\" },{\"deliveryTag\":5, \"body\":\"ABAE \", \"messageCount\":5,\"routingKey\":\"queue\" },{\"deliveryTag\":6, \"body\":\"ABkF \", \"messageCount\":4,\"routingKey\":\"queue\" },{\"deliveryTag\":7, \"body\":\"ACQG \", \"messageCount\":3,\"routingKey\":\"queue\" },{\"deliveryTag\":8, \"body\":\"ADEH \", \"messageCount\":2,\"routingKey\":\"queue\" },{\"deliveryTag\":9, \"body\":\"AEAI \", \"messageCount\":1,\"routingKey\":\"queue\" },{\"deliveryTag\":10, \"body\":\"AFEJ \", \"messageCount\":0,\"routingKey\":\"queue\" }]}\r\n");
        }

